    render() {
        return (
            <div>
                <ListItem>
                    <img className="pic" src="https://ss2.bdstatic.com/70cFvnSh_Q1YnxGkpoWK1HF6hhy/it/u=1074417518,1198280004&fm=26&gp=0.jpg" />
                    <ListInfo>
                        <h3 className="title">《白鹿原》：一本有点颜色的书？</h3>
                        <p className="desc">初二时，在图书馆借了《白鹿原》，我后桌一名男生看到后，怪笑一声，然后用一种神秘的口吻对我说：“哇，你也看这书啊！我看了不到四章，我爸就不让我看了...</p>
                    </ListInfo>
                </ListItem> 
            </div>
        )
    }
}

const mapState = (state) => ({
        
})

export default connect(mapState,null)(List)
